# ------------------------------------------------------------

DROP TABLE `lg_videostatistic`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `lg_videostatistic`
AS SELECT
   `lg_statistic`.`publicVideos` AS `public`,
   `lg_statistic`.`privateVideos` AS `private`,
   `lg_statistic`.`publicVideos` + `lg_statistic`.`privateVideos` AS `total`,
   `lg_statistic`.`createDate` AS `date`,(select case to_days(current_timestamp()) - to_days(`lg_statistic`.`createDate`) when 0 then 0 when 1 then 'DAY' when 7 then 'WEEK' when 31 then 'MONTH' when 365 then 'YEAR' end) AS `timespan`,(select count(0)
FROM `lg_video` where `lg_video`.`openAccess` = 1 and `lg_video`.`filename` > '') - `lg_statistic`.`publicVideos` AS `publicDiff`,(select count(0) from `lg_video` where `lg_video`.`openAccess` = 0 and `lg_video`.`filename` > '') - `lg_statistic`.`privateVideos` AS `privateDiff`,`lg_statistic`.`publicVideos` + `lg_statistic`.`privateVideos` AS `totalDiff` from `lg_statistic` group by (select case to_days(current_timestamp()) - to_days(`lg_statistic`.`createDate`) when 0 then 0 when 1 then 'DAY' when 7 then 'WEEK' when 31 then 'MONTH' when 365 then 'YEAR' end);

